import React from 'react'
import Maincom from './Maincom'
import Rightmain from './Rightmain'
import "./Superdiv.css"

const Mainsuper = () => {
    return (
        // <div style={{ display: 'flex', flexDirection: 'row' }} className='super'>
        //     <Maincom/>
        //     <Rightmain/>
        // </div>
        <div className="container">
            <div className="co">
                <div className="col-md-6 mx-2">
                    <Maincom />
                </div>
                <div className="col-md-6 mx-2">
                    <Rightmain />
                </div>
            </div>
        </div>

    )
}

export default Mainsuper
